import React from "react";

function Footer() {
  return(
    <div>

    <footer>
    <p class = "attribution">
    Challenge by <a href = "https://www.frontendmentor.io?ref=challenge"
    target = "_blank" > Frontend Mentor </a>.
    Coded by < a href = "#" > Amanda Bandi </a>. </p> 
    </footer>
    
    </div>
  );
}

export default Footer;
